/* styles */
import style from './postteaser.scss';

const PostTeaser = ({ posttitle, intro, link }) => {
	return (
		<div className={style.root}>
			<div>
			<a href={link}><h2>{posttitle}</h2>
			<p>{intro}</p></a>
			</div>
		</div>
	);
};

export default PostTeaser;
